// Display messages in the console.
function log(message, type = 'INFO') {
    console.log(`${new Date()} [${type}] ${message}`);
}

// Display errors when executing SQL queries.
function transactionError(tx, error) {
    log(`SQL Error ${error.code}. Message: ${error.message}.`, ERROR);
}

function transactionSuccessForTable(tableName) {
    log(`Create table '${tableName}' successfully.`);
}

function transactionSuccessForTableData(tableName, id, name) {
    log(`Insert (${id}, "${name}") into '${tableName}' successfully.`);
}

function prepareDatabase(db) {
    db.transaction(function (tx) {
         // Create table PROPERTY.
         var query = `CREATE TABLE IF NOT EXISTS Property (
            Id INTEGER PRIMARY KEY AUTOINCREMENT,
            Name TEXT UNIQUE NOT NULL,
            Street TEXT NOT NULL,
            City INTEGER NOT NULL,
            District INTEGER NOT NULL,
            Ward INTEGER NOT NULL,
            Type INTEGER NOT NULL,
            Bedroom INTEGER NOT NULL,
            Price REAL NOT NULL,
            Furniture INTEGER NULL,
            Reporter TEXT NOT NULL,
            Image BLOB,
            DateAdded REAL NOT NULL
        )`;

        tx.executeSql(query, [], transactionSuccessForTable('Property'), transactionError);

          // Create table NOTE.
          query = `CREATE TABLE IF NOT EXISTS Note (
            Id INTEGER PRIMARY KEY AUTOINCREMENT,
            Message TEXT NOT NULL,
            DateAdded REAL NOT NULL,
            PropertyId INTEGER NOT NULL,
            FOREIGN KEY (PropertyId) REFERENCES Property(Id) ON DELETE CASCADE
        )`;

        tx.executeSql(query, [], transactionSuccessForTable('Note'), transactionError);

          // Create table Image.
          query = `CREATE TABLE IF NOT EXISTS Image (
            Id INTEGER PRIMARY KEY AUTOINCREMENT,
            Image BLOB NOT NULL,
            DateAdded REAL NOT NULL,
            PropertyId INTEGER NOT NULL,
            FOREIGN KEY (PropertyId) REFERENCES Property(Id) ON DELETE CASCADE
        )`;

        tx.executeSql(query, [], transactionSuccessForTable('Image'), transactionError);

        // Create table CITY.
        var query = `CREATE TABLE IF NOT EXISTS City (
            Id INTEGER PRIMARY KEY,
            Name TEXT NOT NULL
        )`;

        tx.executeSql(query, [], transactionSuccessForTable('City'), transactionError);

        // Create table DISTRICT.
        query = `CREATE TABLE IF NOT EXISTS District (
            Id INTEGER PRIMARY KEY,
            Name TEXT NOT NULL,
            CityId INTEGER NOT NULL,
            FOREIGN KEY (CityId) REFERENCES City(Id)
        )`;

        tx.executeSql(query, [], transactionSuccessForTable('District'), transactionError);

        // Create table WARD.
        query = `CREATE TABLE IF NOT EXISTS Ward (
            Id INTEGER PRIMARY KEY,
            Name TEXT NOT NULL,
            DistrictId INTEGER NOT NULL,
            FOREIGN KEY (DistrictId) REFERENCES District(Id)
        )`;

        tx.executeSql(query, [], transactionSuccessForTable('Ward'), transactionError);

        query = `SELECT * FROM City WHERE Id = 1 LIMIT 1`;
        tx.executeSql(query, [], function (tx, result) {
            if (result.rows[0] == null)
                addCity();
        }, transactionError);

        query = `SELECT * FROM District WHERE Id = 1 LIMIT 1`;
        tx.executeSql(query, [], function (tx, result) {
            if (result.rows[0] == null)
                addDistrict();
        }, transactionError);

        query = `SELECT * FROM Ward WHERE Id = 1 LIMIT 1`;
        tx.executeSql(query, [], function (tx, result) {
            if (result.rows[0] == null)
                addWard();
        }, transactionError);
    });
}

